import React, { useEffect, useState } from 'react';

interface State {
    transaction: {
        transaction_id: number,
        customer_id: string,
        total_price: number,
        currency: string,
        cerdit_card_type: string,
        cerdit_card_number: string
    }
}


const TransactionList = () => {

    const [transactions, setTransactions] = useState<[State["transaction"]]>();


    const deleteTransaction = async id => {
        try {
            const deleteTodo = await fetch(`http://localhost:3001/transactions/${id}`, {
                method: "DELETE"
            });
            setTransactions(transactions.filter(tr => todo.todo_id !== id));
        } catch (err) {
            console.error(err);
        }
    }

    const getTransactions = async () => {
        try {
            const res = await fetch("http://localhost:3001/transactions");
            const jsonData = await res.json();
            setTransactions(jsonData);

        } catch (err) {
            console.error(err)
        }
    }

    useEffect(() => {
        getTransactions();
    }, [])

    return (
        <div>
            <table className="table mt-5 text-center">
                <thead>
                    <tr>
                        <th>CustomerId</th>
                        <th>Total Price</th>
                        <th>Currency</th>
                        <th>Credit Card Type</th>
                        <th>Credit Card Number</th>
                        <th>Edit</th>
                        <th>Delete</th>
                    </tr>
                </thead>
                <tbody>
                    {transactions?.map(trans => (
                        <tr key={trans.transaction_id}>
                            <td>{trans.customer_id}</td>
                            <td>{trans.total_price}</td>
                            <td>{trans.currency}</td>
                            <td>{trans.cerdit_card_type}</td>
                            <td>{trans.cerdit_card_number}</td>
                            <td>
                                <button
                                    className="btn btn-danger"
                                    onClick={()=> deleteTransaction(trans.transaction_id)}>
                                    Edit</button>
                            </td>
                            <td>
                                <button>Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    )
}

export default TransactionList;
